  const product = data.products.find(x => x._id === req.params.id);
  if(product) {
    res.send(product);
  } else {
    res.status(404).send({message: 'Данный товар сейчас отсутствует на складе!'});
  }
})

app.listen(5000, () => {
  console.log('Сервер запущен...');
});

